import React, { Component } from 'react';

// import { Container } from './styles';

export class FormuserDetails extends Component {
  continue = e => {
    e.preventDefault();
    this.props.nextStep();
  };

  render() {
    return (
      <div>
        <h1>Hello World</h1>
      </div>
    );
  }
}
